"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De aanbieder levert Wmo-ondersteuning of Jeugdhulp aan de client en houdt daarbij rekening met de ontvangen toewijzing en contractafspraken met de gemeente. Afhankelijk van de afspraken met de gemeente kan de aanbieder de start van de ondersteuning en de beeindiging daarvan melden aan de gemeente.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
