"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het gebruik van de regieberichten is voor de uitvoeringsvarianten inspannings- en outputgericht verplicht (met uitzondering van voor de Gecertificeerde Instellingen). Een Stopbericht kan alleen worden verstuurd indien er een bijbehorend Startbericht aanwezig is. Bij leveringen gestart voor het verplicht stellen van de regieberichten (iWmo/iJw release 2.4) kan het zo zijn dat er geen Startbericht gestuurd is. Bij eindigen van de levering kan in dat geval geen Stopbericht worden verstuurd.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO305","id":28387,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW307","id":29164,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW305","id":29812,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO307","id":29997,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP295"}}}]
