"28143" : {
"id":28143,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Starten Wmo-ondersteuning",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Met het Startbericht geeft de aanbieder aan de gemeente door wanneer hij gestart is met de levering. Het bericht is bedoeld om de gemeente inzicht te geven in het daadwerkelijk plaatsvinden van de levering van zorg en ondersteuning. Er kunnen geen rechten ontleend worden aan dit bericht, dat wil bijvoorbeeld zeggen dat er geen afhankelijkheid met de betaling (declaratie) mag bestaan. Het Startbericht is daarmee &#233;&#233;n van de regieberichten. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Binnen een inspannings- of outputgerichte werkwijze is het Startbericht gerelateerd aan de toewijzing, het sleutelveld ToewijzingNummer is dan gevuld met het ToewijzingNummer uit de toewijzing. Na een toewijzing wordt &#233;&#233;n startbericht gestuurd om aan te geven dat de levering conform die toewijzing gestart is. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Binnen een taakgerichte werkwijze kan het Startbericht gebruikt worden in het kader van regievoering door de gemeente. Het bericht is in dat geval nooit gerelateerd aan een toewijzing en daardoor zal het ToewijzingNummer leeg zijn. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Het Startbericht bevat de clientgegevens en de gegevens over de producten waarvoor de levering is gestart. Indien het Startbericht is gerelateerd aan een toewijzing, dan geldt dat het product in het Startbericht gelijk is aan het product in de Toewijzing. Dit geldt zowel voor een aspecifieke toewijzing (indien de productcategorie is gevuld) als voor een specifieke toewijzing (waarbij productcategorie en productcode beide gevuld zijn). Indien er sprake is van een generieke toewijzing (waarbij productcategorie en productcode beide niet gevuld zijn), wordt het startzorg bericht ook generiek ingevoerd (geen productcategorie en productcode).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b><i></span><span style=\" font-size: 10pt; font-family: Arial;\"></span><span style=\" font-size: 9pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\">Doorgeven wijziging client situatie.&nbsp;<p style=\"margin-top: 3pt;\"></b></i>Na ontvangst van de toewijzing is gestart met het leveren van ondersteuning en is het proces Leveren ondersteuning actief. Dit wordt bevestigd door het sturen van een startbericht. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Binnen dit proces kan een verandering ontstaan in de situatie van de client, waardoor hij bijvoorbeeld meer of andere ondersteuning nodig heeft. Er is in dat geval een aanpassing nodig van de te leveren zorg of ondersteuning. De aanbieder heeft hiervoor toestemming nodig van de gemeente. Om die toestemming aan te vragen, stuurt de aanbieder een verzoek om wijziging bericht. Hierin wordt de volledige gewenste nieuwe situatie weergegeven, het bericht bevat:&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Ongewijzigde producten, hiervan wordt alleen het toewijzingnummer ingevuld&nbsp;<p style=\"margin-top: 3pt;\">* Te wijzigen producten, hiervan wordt op basis van het toewijzingnummer aangegeven wat de nieuwe einddatum, omvang of budget moet zijn.&nbsp;<p style=\"margin-top: 3pt;\">* Nieuw producten, hierin worden alle nieuwe producten opgegeven(inclusief datums, omvang en eventueel budget).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Afhankelijk van de soort wijziging wordt er een nieuwe en/of gewijzigde toewijzing gestuurd. Bijvoorbeeld wanneer een ander product nodig is wordt een nieuwe toewijzing verzonden waarin het vorige toegewezen product wordt ingetrokken en een ander product wordt toegewezen. Wanneer hetzelfde product langer, of juist korter, geleverd moet worden, wordt een gewijzigde toewijzing gestuurd met hetzelfde product met een andere einddatum.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Net als bij het verwerken van een verzoek om toewijzing (zie proces 2.5 verzoek om toewijzing) kan een gemeente het verzoek honoreren met een toewijzing bericht, of afwijzen met een antwoordbericht. Ook hier kan de gemeente met een antwoordbericht aangeven dat er naar aanleiding van het verzoek eerst onderzoek gedaan moet worden alvorens en besluit kan worden genomen.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Na ontvangst van de nieuwe toewijzing geeft de aanbieder met een startbericht door dat de levering gestart is. Indien een voorgaande toewijzing wordt ingetrokken, geeft de aanbieder door dat de levering op die toewijzing beeindigd is, zoals beschreven in het deelproces Beeindigen. Indien het een gewijzigde toewijzing betreft en er sprake is van doorlopende zorg, dan hoeft de aanbieder dit niet te melden met een nieuw startbericht.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Een opsomming van de verschillende situaties rond wijziging en sturen van nieuw Toewijzingbericht staat beschreven in Procesbeschrijving Toeleiden/Intrekken Wmo-ondersteuning.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
