"28481" : {
"id":28481,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV057: Hoe moet BerekendBedrag in de Prestatie gevuld worden?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">BerekendBedrag wordt alleen gevuld indien ProductTarief gevuld is.&nbsp;<p style=\"margin-top: 3pt;\">ProductTarief is niet gevuld als Eenheid in de Prestatie 83 (Euro's) is. In alle andere gevallen is ProductTarief wel gevuld.&nbsp;<p style=\"margin-top: 3pt;\">Indien BerekendBedrag gevuld moet worden, wordt deze berekend door GeleverdVolume in de Prestatie te vermenigvuldigen met ProductTarief in de Prestatie.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wanneer de gemeente een ingediende prestatie op een declaratie gedeeltelijk toekent, vult de gemeente in het retourbericht ook GemeenteBerekendBedrag in. Dit is het bedrag dat volgens de gemeente het berekende bedrag is. De gemeente maakt hierbij gebruik van de contractafspraken die met de aanbieder zijn gemaakt (tarief per eenheid, maximaal te leveren volume etc.). Het verschil tussen BerekendBedrag in de ingediende Prestatie en GemeenteBerekendBedrag in de Prestatie in het retourbericht stelt de aanbieder in staat de gegevens in de eigen administratie aan te passen, bijvoorbeeld het te gebruiken tarief.&nbsp;<p style=\"margin-top: 3pt;\">Bij een factuur is het niet mogelijk om een prestatie gedeeltelijk toe te kennen.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wanneer het ingediende bedrag op een prestatie in een declaratie of factuurbericht volledig wordt afgewezen, wordt GemeenteBerekendBedrag gevuld met 0 (zie IV056).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CDT_IngediendeBedragPrestatie","id":30584,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"CDT_ToegekendeBedragPrestatie","id":30601,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV057"}}}]
}
]
}
