"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een verzoek om toewijzing bericht wordt altijd verstuurd op basis van een (wettelijke) verwijzing of een open beschikking. &nbsp;<p style=\"margin-top: 3pt;\">Voor het product en de toewijzingsperiode dat met het verzoek wordt aangevraagd is er nog geen toewijzing voor dat product. &nbsp;<p style=\"margin-top: 3pt;\">Een verzoek om toewijzing bericht kan niet gebruikt worden als er al een actuele toewijzing is voor dat product voor die periode.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"JW315","id":28738,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO315","id":28315,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP307"}}}]
