"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Bij datatypen van het type time is het niet toegestaan om een tijdzone mee te geven. Alleen HH:MM:SS (en optioneel miliseconden .mmm) is toegestaan&nbsp;<p style=\"margin-top: 3pt;\">Bijvoorbeeld:&nbsp;<p style=\"margin-top: 3pt;\">13:59:41 of 13.59.41.123 is toegestaan&nbsp;<p style=\"margin-top: 3pt;\">13.59.41+1 is niet toegestaan&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Constraint":{"code":"RS034","XSD string":"pattern value =\"[^Z+-]+\""}}}]
