"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het gebruik van de regieberichten is voor de uitvoeringsvarianten inspannings- en outputgericht verplicht (met uitzondering van voor de Gecertificeerde Instellingen). Gemeente en aanbieder maken onderling afspraken welke datums gehanteerd moeten worden om de start en stop van de levering door te geven. Deze afspraak kan per product afwijken, maar dit heeft niet de voorkeur.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO305","id":28387,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW307","id":29164,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW305","id":29812,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO307","id":29997,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP270","geen technische regels":false}}}]
