"30208" : {
"id":30208,
"typeIconPath":"data/icons/ArchiMate/AllView.png",
"data" : [
{
"lang":"nl",
"name":"Toeleiden",
"type":"Totaalview classic",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<b><span style=\" font-size: 10pt;\">Inspanningsgerichte en outputgerichte uitvoeringsvariant</b>&nbsp;<p style=\"margin-top: 3pt;\">De informatiestroom rondom de toeleiding is van belang om een rechtmatige uitvoering te kunnen doen binnen de uitvoeringsvarianten inspanningsgericht en outputgericht.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><i>Toewijzen</i>: De gemeente wijst de producten, die in de beschikking zijn vastgelegd, toe aan een of meerdere Wmo aanbieders. De Wmo aanbieder krijgt daarmee de opdracht om voor de client de toegewezen producten te leveren. De aanbieder stuurt altijd een retourbericht om aan te geven dat het toewijzingsbericht ontvangen is. Het versturen van dit retourbericht is belangrijke informatie, die ook de gemeente kan gebruiken in haar contact met de client. Indien de aanbieder de opdracht niet kan of wil accepteren, neemt hij daarna buiten het berichtenverkeer om contact op met de gemeente.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><i>Intrekken</i>: Indien de gemeente constateert dat een toegewezen product niet meer geleverd hoeft te worden, wordt de toewijzing voor dit product ingetrokken. Daarmee wordt de opdracht voor de Wmo aanbieder beeindigd. De gemeente trekt de toewijzing in bijvoorbeeld als de client overlijdt, verhuist naar een andere gemeente of voor het betreffende product een Persoonsgebonden Budget (pgb) gaat ontvangen.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Inspanningsgericht&nbsp;<p style=\"margin-top: 3pt;\"></b>De gemeente en aanbieder maken duidelijke afspraken over de levering. De toewijzing kan specifiek, aspecifiek of generiek zijn. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Bij een specifieke toewijzing is in de toewijzing opgenomen welk product er moet worden geleverd, wat het volume in tijdseenheden is en met welke frequentie er geleverd mag worden, voor ondersteuningsproducten met de eenheid stuks (inspanning) wordt een tarief per stuk afgesproken. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Bij een aspecifieke toewijzing is het aan de aanbieder te bepalen welke van de gecontracteerde producten binnen de categorie worden ingezet. Daarbij wordt geen volume of frequentie aangegeven, maar kan met een budget worden aangegeven hoeveel er maximaal in de betreffende periode besteed mag worden aan zorg of ondersteuning.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Bij een generieke toewijzing zijn zowel productcategorie als productcode leeg, en wordt alleen het maximum bedrag in het budget aangegeven dat in de betreffende periode aan zorg of ondersteuning gedeclareerd mag worden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Een gemeente kan meerdere toewijzingen tegelijkertijd (mits niet gestapeld) toewijzen aan een aanbieder. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Outputgericht&nbsp;<p style=\"margin-top: 3pt;\"></b>De gemeente en aanbieder maken duidelijke afspraken over de te behalen output. De manier waarop deze output wordt behaald, is niet vastgelegd. Bij outputgerichte uitvoering is er een vooraf gedefinieerd product. In de toewijzing is opgenomen welke producten er moeten worden geleverd, hoeveel (in aantal) of voor welk bedrag (in euro's) en met welke frequentie.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Taakgerichte uitvoeringsvariant </b>&nbsp;<p style=\"margin-top: 3pt;\">Binnen een taakgerichte uitvoeringsvariant wordt de toegang tot zorg en/of ondersteuning bepaald door de aanbieder; de gemeente speelt geen rol bij de toegang (geen toewijzing door gemeenten). &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De gemeente geeft een taak aan de aanbieder voor zorg en/of ondersteuning van een (deel)populatie. Deze aanbieder heeft de vrijheid om de invulling van deze taak vorm te geven. De aanbieder krijgt hiervoor een vooraf afgesproken totaalbedrag. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
