"31408" : {
"id":31408,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Berichtenverkeer Toewijzen",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Na ontvangst van een Toewijzing stuurt de aanbieder altijd binnen drie werkdagen een retourbericht om aan te geven dat de toewijzing ontvangen is.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien het heenbericht niet aan de technische specificaties voldoet, kan het worden afgekeurd in een retourbericht. De verzender van het heenbericht kan de afgekeurde cli&#235;nten opnieuw aanleveren in een nieuwe Toewijzing. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
