"39164" : {
"id":39164,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Beeindigen Jeugdhulp",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Met het Stopbericht geeft de aanbieder aan de gemeente door wanneer de levering beeindigd is en wat de reden is van de beeindiging. Het bericht is bedoeld om de gemeente inzicht te geven in het daadwerkelijk plaatsvinden van de levering van zorg en ondersteuning. Er kunnen geen rechten ontleend worden aan dit bericht, dat wil bijvoorbeeld zeggen dat er geen afhankelijkheid met de betaling (declaratie) mag bestaan. Het Stopbericht is daarmee &#233;&#233;n van de regieberichten. &nbsp;<p style=\"margin-top: 3pt;\">De start van de levering wordt voor de uitvoeringsvarianten inspannings- en outputgericht verplicht (met uitzondering van voor de Gecertificeerde Instellingen) altijd doorgegeven met een Startbericht en de beeindiging van de levering wordt altijd doorgegeven met een Stopbericht. De beeindiging kan plaatsvinden op initiatief van de gemeente: de aanbieder ontvangt een Intrekkingbericht van de gemeente. Met het Stopbericht geeft de aanbieder door wanneer de levering definitief gestopt is. &nbsp;<p style=\"margin-top: 3pt;\">Ook als de einddatum conform de einddatum uit de Toewijzing is wordt een Stopbericht gestuurd. &nbsp;<p style=\"margin-top: 3pt;\">Na het sturen van een Stopbericht kan er binnen de kaders van de toewijzing opnieuw een Startbericht worden gestuurd, bijvoorbeeld in het geval van een tijdelijke beeindiging. Het is niet toegestaan om tegelijkertijd meerdere Startberichten te versturen zonder tussenliggende stop. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De be&#235;indiging kan ook plaatsvinden op initiatief van de aanbieder. De aanbieder stuurt altijd een Stopbericht aan de gemeente wanneer de start van de levering met een Startbericht is doorgegeven. Het is vervolgens aan de gemeente om de betreffende toewijzing al dan niet overeenkomstig met een intrekkingsbericht te beeindigen. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Bij een tijdelijke be&#235;indiging, bijvoorbeeld indien de cli&#235;nt wordt opgenomen in het ziekenhuis, verwacht de aanbieder dat de levering van de toegewezen jeugdhulp op een later moment weer hervat wordt. De afgegeven toewijzing blijft geldig en blijft bij de gemeente open staan. (toewijzing aanhouden). De aanbieder houdt contact met de cli&#235;nt en geeft aan de gemeente door wanneer de levering hervat wordt ofwel definitief wordt be&#235;indigd (monitoren).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Het Stopbericht is altijd gerelateerd aan een eerder verzonden Startbericht op basis van de elementen in de logische sleutel.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Het Stopbericht bevat cli&#235;ntgegevens en gegevens over de producten waarvoor de levering be&#235;indigd is. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
