"lang":"nl",
"name":"Stap 1: Aanbieder stuurt Verzoek om Toewijzing  Meneer Gaastra heeft van de gemeente een beschikking ontvangen en gaat daarmee naar de gecontracteerde Zorgaanbieder De Regenboog. Deze stuurt vervolgens een Verzoek om Toewijzing om de gemeente te laten weten dat  Meneer Gaastra voor hem heeft gekozen en wenst graag een Toewijzing voor de betreffende productcategorie.",
