"name":"Stap 3: Declareren producten  De aanbieder levert in de maand augustus twee producten  die volgens de afgesproken productcodelijst behoren bij de toegewezen productcategorie. Met de lijst wordt de  productcodelijst bedoeld die in het contract tussen gemeente en aanbieder is vastgelegd om aan te geven welke producten door  de aanbieder mogen worden geleverd en die moet worden  gebruikt in het berichtenverkeer. Dit kan zowel de landelijke productcodelijst als een eigen samengestelde productcodelijst  zijn. De aanbieder dient op de ontvangen aspecifieke toewijzing twee prestaties in. Per product wordt aangegeven wat het  bedrag is dat de aanbieder declareert over de maand augustus.",
